'''
With Google's OR-Tools
'''
from ortools.linear_solver import pywraplp

def hitting_set_with_ortools(sets):
    # Step 1: Initialize the solver
    solver = pywraplp.Solver.CreateSolver('SCIP')  # or 'CBC' for a different solver # SCIP
    if not solver:
        print("Solver not found.")
        return None

    # Step 2: Define variables for each unique element in the universal set
    all_elements = set(element for subset in sets for element in subset)
    element_vars = {element: solver.BoolVar(f'x_{element}') for element in all_elements}
    
    # Step 3: Define the objective function - minimize the sum of chosen elements
    solver.Minimize(solver.Sum(element_vars[element] for element in all_elements))

    # Step 4: Add constraints - each subset must be hit by at least one chosen element
    for subset in sets:
        solver.Add(solver.Sum(element_vars[element] for element in subset) >= 1)

    # Step 5: Solve the problem
    status = solver.Solve()
    
    # Step 6: Retrieve the solution
    if status == pywraplp.Solver.OPTIMAL:
        hitting_set = {element for element in all_elements if element_vars[element].solution_value() == 1}
        print("Minimum Hitting Set (Exact Solution):", hitting_set)
        print("Objective Value (size of hitting set):", solver.Objective().Value())
        return hitting_set
    else:
        print("No optimal solution found.")
        return None

